import ItemLink from "../shared/components/ItemLink"

const FooterTop = () => {

    const navigationFirstLinkList = [
        {
            href: "link",
            content: "Компания"
        },
        {
            href: "link",
            content: "Новости"
        },
        {
            href: "link",
            content: "Каталог"
        },
        {
            href: "link",
            content: "Доставка"
        },
        {
            href: "link",
            content: "Контакты"
        },
    ]

    const navigationSecondaryLinkList = [
        {
            href: "link",
            content: "Материалы"
        },
        {
            href: "link",
            content: "Техника"
        },
        {
            href: "link",
            content: "Инструмент"
        },
        {
            href: "link",
            content: "Спецпредложения"
        },
    ]

    return (
        <div class="footer-top">
                <div class="container">
                    <div class="footer-top-inner">
                        <div class="footer-top__left">
                            <a class="company-name" href="link">Техномарт</a>
                            <p class="footer-adrees-desc">г. Санкт-Петербург, ул. Б.Конюшенная, д. 19/8<br />+7(812)
                                555-05-55</p>
                        </div>
                        <div class="footer-navigation">
                            <ul class="footer-navigation__first">
                                {navigationFirstLinkList.map((item) => <ItemLink className={"navigation-first__link"} href={item.href} content={item.content}></ItemLink>)}
                            </ul>
                            <ul class="footer-navigation__secondary">
                                <li><a class="navigation-secondary__link" href="link">Материалы</a></li>
                                <li><a class="navigation-secondary__link" href="link">Техника</a></li>
                                <li><a class="navigation-secondary__link" href="link">Инструмент</a></li>
                                <li><a class="navigation-secondary__link" href="link">Спецпредложения</a></li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
    )
}

export default FooterTop
